const api = createApi(
  SplashBackend.new({
    network: 'mainnet',
    metadata: false,
  }),
);
api.selectWallet(() => cip30Bridge.enable());

test('it should create valid api object and returns base api fields', async () => {
  expect(api.network).toBe('mainnet');
  expect(api.getAddresses).toBeInstanceOf(Function);
  expect(await api.getActiveAddress()).toBe(
    'addr1q9cehmjzf2tmtzeae2y0uhdxl6kxf992wgn0ja0n2pk9kftcgmmtkpl4k2p93p0y2qn8ne5eknnq5rzxpxjxhs652nxsqwq3mt',
  );
  const addresses = await api.getAddresses();

  expect(addresses).toBeInstanceOf(Array);
  expect(addresses[1]).toBe(
    'addr1q9cehmjzf2tmtzeae2y0uhdxl6kxf992wgn0ja0n2pk9kftcgmmtkpl4k2p93p0y2qn8ne5eknnq5rzxpxjxhs652nxsqwq3mt',
  );

  const pkhs = await api.getPaymentKeysHashes();
  expect(pkhs).toBeInstanceOf(Array);
  expect(pkhs[0]).toBe(
    '719bee424a97b58b3dca88fe5da6feac6494aa7226f975f3506c5b25',
  );

  const balance = await api.getBalance();

  expect(balance).toBeInstanceOf(Currencies);
  expect(balance.ada.amount).toBe(100n);
  expect(balance.spf.amount).toBe(EMISSION_LP);
});

test('it should correct proxy methods call to backend', async () => {
  expect(await api.getAdaUsdRate()).toBeInstanceOf(Price);
  expect((await api.getTradeOpenOrders()).orders).toBeInstanceOf(Array);
});
